webpackJsonp([0x7a995f7e0e01],{411:function(a,n){a.exports={data:{markdownRemark:{html:'<p>Tak terasa sudah lama saya tidak memperbaharui blog saya <img class="emoji-icon" data-icon="emoji-sweat_smile" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Selama blog saya tidak update, tentu banyak hal yang saya lakukan di dunia nyata salah satunya mengajar OSN baik pada OSK, OSP, maupun OSN. Ketika saya mengajar, ada satu hal yang saya sadari menjadi pembeda antara calon juara dengan yang tidak.</p>\n<p>Dahulu, saya ingat pernah membagikan status yang isinya kira-kira para medalis OSN dapat menjadi medalis salah satu faktornya karena baiknya kondisi (seperti sarana dan pelatda) yang mereka dapatkan. Saya membagikan status itu karena saya sendiri merasa saya dapat menjadi medalis salah satunya karena baiknya pelatda DKI Jakarta yang mungkin tidak dimiliki daerah lain. Namun, di status tersebut terjadi tubir karena ada hal sensitif yang dibahas yang kira-kira intinya “sebenarnya ada orang yang berusaha lebih keras dari pada kamu tapi tidak jadi medalis karena buruknya kondisi mereka.” Tentu banyak yang tidak setuju karena bagi mereka ini membunuh semangat para siswa yang akan bertanding pada OSN, terlebih lagi status itu muncul seingat saya mendekati OSK 2018.</p>\n<p>Silakan baca komik <a href="http://thewireless.co.nz/articles/the-pencilsword-on-a-plate">http://thewireless.co.nz/articles/the-pencilsword-on-a-plate</a> jika ingin benar-benar mengetahui duduk permasalahannya. Saat itu, saya setuju karena bagi saya terlalu sombong untuk mengatakan saya berhasil menjadi medalis hanya karena usaha saya saja, tidak mempertimbangkan faktor lain seperti Provinsi DKI Jakarta yang benar-benar niat mempersiapkan OSN, konten-konten dari IA-TOKI yang membantu untuk belajar mandiri, dan tentunya dukungan orang tua saya. Namun seiring berjalannya waktu, saya memiliki pandangan sedikit berbeda terhadap komik tersebut terutama tentang “kerja keras”.</p>\n<p>Sebelumnya, saya ingin flashback sebentar di saat saya mengikuti acara pelatihan/motivasi dari Sigma Academy saat kelas 8 SMP. Dari sekian banyak materi yang disampaikan, ada satu materi unik yang cukup menarik perhatian saya tentang meraih tujuan. Biasanya, orang-orang terutama para motivator pasti menyemangati kita untuk terus bekerja keras karena banyak saingan kita yang akan merebut posisi kita jika tidak. Berbeda dengan orang kebanyakan, Sigma Academy menyampaikan sesuatu yang bertolak belakang. <strong>Sebenarnya, sainganmu dalam meraih tujuan itu sedikit</strong>. Mau masuk SMA X? Sedikit saingannya. Mau kuliah di X? Sedikit saingannya. Saat itu dicontohkan bahwa untuk meraih gelar juara dunia bulu tangkis, sebenarnya hanya beberapa orang yang perlu dilawan, bukan seluruh dunia.</p>\n<p>Lalu apa hubungannya dengan OSN? Sebenarnya, jika kamu ingin menjadi medalis, sedikit saingannya! Tidak percaya? mari kita lihat data kunjungan <a href="https://osn.toki.id">https://osn.toki.id</a> menjelang OSK.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/kunjungan-4150f390107e943812fca32878c72a36-ee7d1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 638px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.3448275862069%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="kunjungan"\n        title=""\n        src="/static/kunjungan-4150f390107e943812fca32878c72a36-ee7d1.png"\n        srcset="/static/kunjungan-4150f390107e943812fca32878c72a36-c235e.png 163w,\n/static/kunjungan-4150f390107e943812fca32878c72a36-5eba7.png 325w,\n/static/kunjungan-4150f390107e943812fca32878c72a36-ee7d1.png 638w"\n        sizes="(max-width: 638px) 100vw, 638px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Kunjungan meningkat sangat tajam.</em></p>\n<p>Dari data tersebut, dapat dilihat bahwa banyak sekali peserta OSK yang deadliner! Alasannya tentu beragam, salah satu yang mungkin dan sangat disayangkan adalah baru diberitahu guru menjelang OSK. Artinya, untuk menjadi juara OSK sebenarnya lawanmu bukan saja sedikit (hanya beberapa siswa per sekolah), namun juga sedikit yang melakukan persiapan. Bagi saya, siswa-siswa deadliner ini tidak layak untuk lolos sehingga biasanya saya hanya mempertimbangkan siswa-siswa yang memiliki persiapan, mari kita sebut mereka sebagai “lawan sebenarnya”. Dari mereka yang memiliki persiapan, berapa banyak yang telah mencoba soal-soal setidaknya 3 tahun ke belakang? Coba kamu data di daerahmu dan buktikan sendiri bahwa sainganmu sedikit <img class="emoji-icon" data-icon="emoji-simple_smile" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Itu kan OSK, bagaimana dengan OSN? Tidak jauh berbeda! Mari lihat data dari <a href="https://kawal-pjj.herokuapp.com">https://kawal-pjj.herokuapp.com</a>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/pjj-77cc73fc0bf8ae053e10520cb3025137-a0f74.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 34.23831070889894%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="pjj"\n        title=""\n        src="/static/pjj-77cc73fc0bf8ae053e10520cb3025137-10273.png"\n        srcset="/static/pjj-77cc73fc0bf8ae053e10520cb3025137-9b14a.png 163w,\n/static/pjj-77cc73fc0bf8ae053e10520cb3025137-94962.png 325w,\n/static/pjj-77cc73fc0bf8ae053e10520cb3025137-10273.png 650w,\n/static/pjj-77cc73fc0bf8ae053e10520cb3025137-2fc6f.png 975w,\n/static/pjj-77cc73fc0bf8ae053e10520cb3025137-a8a2c.png 1300w,\n/static/pjj-77cc73fc0bf8ae053e10520cb3025137-a0f74.png 1326w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Sebenarnya cukup sulit menentukan batas “memiliki persiapan” pada PJJ ini namun saya coba ambil peringkat 35 sebagai batas karena terlihat sudah cukup banyak mencoba materi pemrograman kompetitif dasar. Oh ya, kira-kira setengah bagian hijau yang di kiri adalah materi pemrograman dasar yang terlalu dasar untuk OSN dan lebih cocok dikatakan latihan untuk OSK/OSP sehingga tidak saya perhitungkan sebagai persiapan OSN. Saat ini, masih ada sekitar 3 minggu sebelum OSN 2018 dimulai. Dengan mempertimbangkan siswa-siswa hebat yang berlatih di OJ lain bukan di TLX dan waktu 3 minggu yang tersisa, mari anggap ada 60 orang yang memiliki persiapan untuk OSN nanti. Jumlah medalis ada 30, artinya, kamu cukup “mengalahkan” satu orang untuk menjadi medalis! (tapi pastikan kamu termasuk yang 60 itu <img class="emoji-icon" data-icon="emoji-simple_smile" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">).</p>\n<p>Selain kurangnya persiapan, banyak juga siswa dengan persiapan (biasanya mendapat pelatihan) yang sebenarnya tidak tertarik dengan OSN. Dari beberapa alumni TOKI, mungkin saya termasuk yang tidak begitu tertarik untuk “menarik” adik-adik kelas kenalan saya untuk menjadi medalis OSN. Alasannya sederhana, saya tidak ingin capek-capek berusaha menjadikan seseorang medalis jika dia sendiri “tidak ingin” menjadi medalis. Terdengar konyol? Faktanya, banyak teman-teman saya yang melatih adik kelasnya mengeluh bahwa sebenarnya malah mereka yang lebih semangat belajar OSN dibanding adik kelasnya yang sebenarnya “dibantu”. Oh ya, jangan salah kaprah, dengan tidak tertarik mengajar adik kelas bukan berarti saya tidak peduli dengan siswa-siswa OSN. Saya sendiri tergabung dalam tim konten TLX karena saya ingin membantu mereka yang walaupun tidak memiliki guru namun ingin menjadi jawara di OSN. Selain itu, tulisan ini sebenarnya merupakan buah kekhawatiran terhadap minat belajar siswa OSN yang masih sedikit <img class="emoji-icon" data-icon="emoji-simple_smile" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">.</p>\n<div class="row justify-content-center">\n    <div class="col-9 col-lg-6">\n        \n  <a class="gatsby-resp-image-link" href="/static/khawatir-7d4911e67862abaa3390e40647b609c3-240ae.jpg" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 177.77777777777777%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="khawatir" title="" src="/static/khawatir-7d4911e67862abaa3390e40647b609c3-b80fa.jpg" srcset="/static/khawatir-7d4911e67862abaa3390e40647b609c3-cf410.jpg 163w,\n/static/khawatir-7d4911e67862abaa3390e40647b609c3-62f2a.jpg 325w,\n/static/khawatir-7d4911e67862abaa3390e40647b609c3-b80fa.jpg 650w,\n/static/khawatir-7d4911e67862abaa3390e40647b609c3-240ae.jpg 720w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n    </div>\n</div>\n<p>Oke, lawanmu sebenarnya sedikit, lalu apakah mudah memenangkan OSN? Tidak juga. Sebenarnya, dari lawanmu yang sedikit itu, sebagian besar adalah orang-orang super yang sulit dikalahkan. Kalau melihat contoh juara bulu tangkis dunia sebelumnya, tentu yang menjadi lawan walaupun sedikit adalah atlet-atlet terbaik di negaranya. Namun dengan mengetahui sedikitnya lawan yang harus dikalahkan, setidaknya membuka sudut pandang baru bahwa kita hanya perlu melawan sedikit orang hebat, bukan banyak orang hebat <img class="emoji-icon" data-icon="emoji-stuck_out_tongue" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">.</p>\n<p>Lalu bagaimana dengan sifat para medalis? Apakah mereka bekerja keras untuk mendapatkan medali? Tentu saja! Saya sendiri bersekolah di sekolah umum, bukan khusus olimpiade. Untuk meraih medali, saya berusaha menghabiskan soal OSK &#x26; OSP 5 tahun ke belakang dan menyelesaikan materi pemrograman kompetitif di TLX hingga bab Dynamic Programming sebelum Pelatda DKI Jakarta dimulai. Saya sendiri menganggap pelatda sebagai bonus karena dapat berkenalan dengan teman-teman yang hebat sehingga memotivasi saya, bukan sebagai satu-satunya saat saya belajar untuk OSN. Indra, juara umum OSN Komputer 2016 membuat daftar soal yang telah diselesaikannya pada Excel. Pernah melihat anak yang jarang belajar tapi pintar? Mungkin Alfian adalah anak yang paling cocok untuk menyandang gelar itu di angkatan saya. Hampir setiap hari waktu Pelatnas 2 di pagi hari ketika semua peserta menyimak materi Dia malah tidur karena begadang bermain Dota semalaman. Walau begitu, Dia lolos ke Pelatnas 3! Apakah Dia tidak belajar? Tidak juga. Ketika Dia terbangun, Dia langsung ngebut mempelajari materinya dari slide. Sehari sebelum kuis/simulasi, Dia mereview apa yang telah dipelajari sampai saat itu. Walaupun belajarnya singkat, tetap saja Dia belajar. Setiap orang memiliki kecepatan yang berbeda dalam belajar bukan? <img class="emoji-icon" data-icon="emoji-wink" style="display: inline; margin: 0; margin-top: 1px; position: relative; width: 20px" src="data:image/png;base64, ">. Intinya, pintar tanpa belajar/kerja keras hanya omong kosong!</p>\n<p>Kembali ke pertanyaan awal, apakah kerja keras cukup untuk meraih medali OSN? Tentu tidak. Selain bekerja keras, kamu tentu harus memiliki sarana yang memadai seperti komputer, internet, serta sumber materi. Untungnya, komputer merupakan salah satu bidang yang peduli terhadap penyebaran materi salah satu contohnya dengan membuat buku Pemrograman Kompetitif Dasar yang dapat diunduh secara gratis <a href="https://osn.toki.id/arsip/download-pkd">di sini</a>.</p>\n<div class="row justify-content-center">\n    <div class="col-9 col-lg-6">\n        \n  <a class="gatsby-resp-image-link" href="/static/dr-strange-pkd-742bbb4f73e9314dd6fb8b56dd960161-749ab.png" style="display: block" target="_blank" rel="noopener">\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="dr strange pkd" title="" src="/static/dr-strange-pkd-742bbb4f73e9314dd6fb8b56dd960161-10273.png" srcset="/static/dr-strange-pkd-742bbb4f73e9314dd6fb8b56dd960161-9b14a.png 163w,\n/static/dr-strange-pkd-742bbb4f73e9314dd6fb8b56dd960161-94962.png 325w,\n/static/dr-strange-pkd-742bbb4f73e9314dd6fb8b56dd960161-10273.png 650w,\n/static/dr-strange-pkd-742bbb4f73e9314dd6fb8b56dd960161-749ab.png 900w" sizes="(max-width: 650px) 100vw, 650px">\n    </span>\n  </span>\n  \n  </a>\n    \n    <em>Belajar PKD.</em>\n    </div>\n</div>\n<p>Oke, cukup promosinya. Jawaban yang serius adalah, seharusnya iya. Saya rasa, asalkan kamu memiliki komputer, internet, dan tentunya semangat yang membara, insyaAllah medali OSN bisa diraih. Mungkin akan ada pemikiran “Bagaimana jika tidak memiliki komputer dan internet? Bukankah sama saja kondisinya seperti komik tadi?” Ya, itu benar. Tapi berdasarkan pengalaman, sebagian besar siswa yang gagal pada OSN disebabkan kurangnya kerja keras mereka sendiri, bukan karena tidak memiliki sarana di atas. Sebagai tambahan, silakan tonton video TED yang cukup baik berkaitan tentang tekad berikut ini. Akhir kata, selamat belajar dan berjuang menjadi yang terbaik!</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.20608899297424%; position: relative; height: 0; overflow: hidden;"\n          >\n            <div style="max-width:854px"><div style="position:relative;height:0;padding-bottom:56.25%"><iframe src="https://embed.ted.com/talks/lang/id/angela_lee_duckworth_grit_the_power_of_passion_and_perseverance" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          " frameborder="0" scrolling="no" allowfullscreen></iframe></div></div>\n          </div>\n          </div>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/bad-good-code-8e66feb17439068459217fb7b4120f8a-8cd7e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 640px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="bad good code"\n        title=""\n        src="/static/bad-good-code-8e66feb17439068459217fb7b4120f8a-8cd7e.png"\n        srcset="/static/bad-good-code-8e66feb17439068459217fb7b4120f8a-bf5b7.png 163w,\n/static/bad-good-code-8e66feb17439068459217fb7b4120f8a-f1b9d.png 325w,\n/static/bad-good-code-8e66feb17439068459217fb7b4120f8a-8cd7e.png 640w"\n        sizes="(max-width: 640px) 100vw, 640px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',
frontmatter:{title:"Apakah Kerja Keras Cukup untuk Meraih Medali OSN?",date:"07 June 2018",description:"Rahasia sederhana yang dimiliki para medalis OSN namun jarang terungkap."},fields:{slug:"/kerja-keras-medali-osn/"}}},pathContext:{slug:"/kerja-keras-medali-osn/"}}}});
